      <text id="131" justification="0" size="4" underlined="false">
        <text>Tests4J creates a instance of itself from
the static api, the Activation bar to the right
represents the protected instance method;
&lt;/br&gt;
&lt;b&gt;&lt;font size=&quot;4&quot;&gt;I_Tests4J_Controls instanceRun(
  I_Tests4J_Params&lt;/font&gt; pParams, 
&lt;font size=&quot;4&quot;&gt;  I_Tests4J_Listener &lt;/font&gt; pListener)&lt;/b&gt;</text>
      </text>
      <color id="132">

      <text id="137" justification="0" size="4" underlined="false">
        <text>The Tests4J_ThreadManager provides 
two java.util.concurrent.ExecutorServices
for the following runnables, 
each has it&apos;s own sequence diagram;
Tests4J_SetupRunnable (Setup.seq)
Tests4J_TrialsRunnable  (Trials.seq)
Tests4J_RemoteRunnable (Remote.seq)
&lt;br/&gt;
Also Note: Tests4J_TrialsRunnables consume 
Tests4J_TrialDescriptions produced by
Tests4J_SetupRunnables.</text>
      </text>
